INSERT INTO `products` (`id`, `title`, `description`, `on_sale`, `on_new`, `on_top`, `sold_count`, `price`, `price_sale`, `weight`, `sex`, `meta`, `brand_id`, `category_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Capita The Black Snowboard Of Death 159', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">The Black Snowboard of Death - один из самых известных сноубордов Capita. Пожалуй все, что в нем сохранилось от первой модели - это название. Сейчас это один из самых высокотехнологичных и резвых сноубордов во всей линейке, сочетающий в себе современные разработки компании и олдскульный дух настоящего пиратства. Направленная геометрия служит для восстановления баланса доски в глубоком снегу, а сочетание рокерного прогиба тейлов и положительного кембера между креплениями обеспечивают невероятный контроль над доской и мощнейший щелчок.&nbsp;</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong> средняя</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень: </strong>продвинутый / эксперт</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong> directional</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong> фрирайд / универсальная</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong> гибрид</span></div>', 0, 0, 0, 0, '319900', NULL, '2.50', 'male', '{\"title\": \"Capita The Black Snowboard Of Death 159\", \"description\": \"The Black Snowboard of Death - один из самых известных сноубордов Capita. Пожалуй все, что в нем сохранилось от первой модели - это название. Сейчас это один из самых высокотехнологичных и резвых сноубордов во всей линейке, сочетающий в себе современные разработки компании и олдскульный дух настоящего пиратства. Направленная геометрия служит для восстановления баланса доски в глубоком снегу, а сочетание рокерного прогиба тейлов и положительного кембера между креплениями обеспечивают невероятный контроль над доской и мощнейший щелчок.\"}', 2, 3, '2021-01-26 09:12:06', '2021-01-26 10:23:00', NULL),
(2, 'Capita The Outsiders 156', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Еще одна традиционная для Capita модель триумфально возвращается и в этом сезоне. The Outsiders - обладатель множества наград, победитель тестов и самое главное - выбор тысяч сноубордистов по всему миру. В этом сезоне их число можете пополнить и Вы, ведь этот сбалансированный и технологичный сноуборд от одного из лидеров индустрии будет максимально соответствовать ожиданиям.</span><br /><br /><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Пока многие парковые доски делаются на основе плоского или обратного прогиба, The Outsider даже не задумывается о таких компромиссах - старый добрый кэмбер, и ничего более. Да, по краям доски есть плоские зоны для большей стабильности, но основа неизменна на протяжении многих сезонов, и именно она отвечает за тотальный контроль, который дает эта классическая технология. Конечно же доска симметрична (и геометрия, и жесткость), что дает максимальную свободу для фристайла. Все тот же легкий, но прочный сердечник в триаксиальной оплетке со вставками из арамидного и льняного волокна для амортизации, щелчка и торсионной жесткости. И, наконец, скользяк Quantum Drive&trade; с повышенной плотностью для максимальной износостойкости.</span><br /><br /><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Как видите, ничего не поменялось - перед нами по-прежнему очень продуманная модель, отвечающая всем требованиям парковых райдеров, которые не прочь иногда прокатиться по трассе или ненадолго выйти за ее пределы. Легкая, комфортная, быстрая - идеальный вариант, если Вам требуется именно он.</span></p>\r\n<div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong>&nbsp;средняя</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:</strong>&nbsp;продвинутый</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong>&nbsp;twin tip</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong>&nbsp;фристайл / универсальная / парк / джиб</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong>&nbsp;гибрид</span></div>\r\n</div>', 0, 0, 0, 0, '258900', NULL, '2.50', 'male', '{\"title\": \"Capita The Outsiders 156\", \"description\": \"Еще одна традиционная для Capita модель триумфально возвращается и в этом сезоне. The Outsiders - обладатель множества наград, победитель тестов и самое главное - выбор тысяч сноубордистов по всему миру. В этом сезоне их число можете пополнить и Вы, ведь этот сбалансированный и технологичный сноуборд от одного из лидеров индустрии будет максимально соответствовать ожиданиям.  Пока многие парковые доски делаются на основе плоского или обратного прогиба, The Outsider даже не задумывается о таких компромиссах - старый добрый кэмбер, и ничего более. Да, по краям доски есть плоские зоны для большей стабильности, но основа неизменна на протяжении многих сезонов, и именно она отвечает за тотальный контроль, который дает эта классическая технология. Конечно же доска симметрична (и геометрия, и жесткость), что дает максимальную свободу для фристайла. Все тот же легкий, но прочный сердечник в триаксиальной оплетке со вставками из арамидного и льняного волокна для амортизации, щелчка и торсионной жесткости. И, наконец, скользяк Quantum Drive™ с повышенной плотностью для максимальной износостойкости.  Как видите, ничего не поменялось - перед нами по-прежнему очень продуманная модель, отвечающая всем требованиям парковых райдеров, которые не прочь иногда прокатиться по трассе или ненадолго выйти за ее пределы. Легкая, комфортная, быстрая - идеальный вариант, если Вам требуется именно он.\"}', 2, 3, '2021-01-26 09:40:30', '2021-01-26 10:23:25', NULL),
(3, 'Capita Mercury 157', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Взяв за основу еще одну легендарную модель брэнда - BSOD, в Capita сделали жесткую и супер-технологичную Mercury, которая идеально подходит как для всех видов катания по трассе и вне ее, так и для периодических заездов в парк. И уж определенно это не доска для новичков - с жесткостью 6.5 она будет слушаться малейшего Вашего движения, и если у Вас за плечами нет серьезного опыта катания, с этим будет непросто справиться.</span><br /><br /><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Удобный и стабильный прогиб Resort V2: основная часть доски между креплениями имеет небольшой классический кэмбер, нос и хвост имеют рокерный прогиб за счет чего края доски плавно загибаются вверх с последующим резким подъемом. Плоское основание позволяет доске быть не только невероятно маневренной, но и стабильной на вылетах и приземлениях, а высоко задранные края позволят доске легче всплывать в глубоком снегу. Бамбуковые вставки для жесткости и щелчка, оплетка из стекловолокна Holysheet&trade; и радиус бокового выреза New Age Directional с технологией Death Grip&trade;. Привлекательная графика, обновленный скользяк HyperDrive&trade;, прочные боковые стенки, защищающие конструкцию сноуборда - как видите, все продумано и технологично. Настоящий шаттл в коллекции Capita, он готов умчать Вас куда угодно!</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong>&nbsp;средняя</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:</strong>&nbsp;продвинутый / эксперт</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong>&nbsp;directional twin</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong> фристайл / фрирайд / универсальная</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong>&nbsp;гибрид</span></div>', 0, 0, 0, 0, '289900', NULL, '2.50', 'male', '{\"title\": \"Capita Mercury 157\", \"description\": \"Взяв за основу еще одну легендарную модель брэнда - BSOD, в Capita сделали жесткую и супер-технологичную Mercury, которая идеально подходит как для всех видов катания по трассе и вне ее, так и для периодических заездов в парк. И уж определенно это не доска для новичков - с жесткостью 6.5 она будет слушаться малейшего Вашего движения, и если у Вас за плечами нет серьезного опыта катания, с этим будет непросто справиться.  Удобный и стабильный прогиб Resort V2: основная часть доски между креплениями имеет небольшой классический кэмбер, нос и хвост имеют рокерный прогиб за счет чего края доски плавно загибаются вверх с последующим резким подъемом. Плоское основание позволяет доске быть не только невероятно маневренной, но и стабильной на вылетах и приземлениях, а высоко задранные края позволят доске легче всплывать в глубоком снегу. Бамбуковые вставки для жесткости и щелчка, оплетка из стекловолокна Holysheet™ и радиус бокового выреза New Age Directional с технологией Death Grip™. Привлекательная графика, обновленный скользяк HyperDrive™, прочные боковые стенки, защищающие конструкцию сноуборда - как видите, все продумано и технологично. Настоящий шаттл в коллекции Capita, он готов умчать Вас куда угодно!\"}', 2, 3, '2021-01-26 09:58:01', '2021-01-26 10:26:23', NULL),
(4, 'Capita Ultrafear 151', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Ultrafear вряд ли нуждается в дополнительном представлении, ведь это очередная легенда от одного из лидеров индустрии - одна из досок, с которой в принципе ассоциируется Capita у большинства сноубордистов по всему миру. Сбалансированный и стабильный сноуборд для фристайла во всех его проявлениях - от про-линии трамплинов в парке до уличных перил.</span><br /><br /><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">В этом сезоне доска предстала перед нами с узнаваемой рубленой геометрией и графикой, но главное, как обычно, скрывается под ними. Это прогиб Park V2 с плоским основанием между креплениями и рокерами на носу и хвосте (маневренность в парке и плавучесть в глубоком снегу), симметричная геометрия и жесткость, дающие максимальную свободу (теперь не имеет значения, какая стойка для Вас основная - доска одинаково стабильна), легкий и прочный сердечник из комбинации тополя и ясеня, специальная демпфирующая система Cork Edge, защищающая доску от ударов, вставки из кевлара и титанала для по-настоящему мощного щелчка и триаксиальная оплетка для лучшей торсионной жесткости.</span><br /><br /><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Конечно же это не всё (с полным списком можно ознакомиться ниже), но даже этого хватило бы для того, чтобы называться хорошей доской. Правда, в Capita не хотят быть &laquo;просто хорошими&raquo;, их планка сильно выше, и Ultrafear ей вполне соответствует.</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:&nbsp;</strong>средняя</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:&nbsp;</strong>продвинутый</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:&nbsp;</strong>twin tip</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:&nbsp;</strong>фристайл / универсальная / парк / джиб</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong>&nbsp;гибрид</span></div>', 0, 0, 0, 0, '247900', NULL, '2.50', 'male', '{\"title\": \"Capita Ultrafear 151\", \"description\": \"Ultrafear вряд ли нуждается в дополнительном представлении, ведь это очередная легенда от одного из лидеров индустрии - одна из досок, с которой в принципе ассоциируется Capita у большинства сноубордистов по всему миру. Сбалансированный и стабильный сноуборд для фристайла во всех его проявлениях - от про-линии трамплинов в парке до уличных перил.  В этом сезоне доска предстала перед нами с узнаваемой рубленой геометрией и графикой, но главное, как обычно, скрывается под ними. Это прогиб Park V2 с плоским основанием между креплениями и рокерами на носу и хвосте (маневренность в парке и плавучесть в глубоком снегу), симметричная геометрия и жесткость, дающие максимальную свободу (теперь не имеет значения, какая стойка для Вас основная - доска одинаково стабильна), легкий и прочный сердечник из комбинации тополя и ясеня, специальная демпфирующая система Cork Edge, защищающая доску от ударов, вставки из кевлара и титанала для по-настоящему мощного щелчка и триаксиальная оплетка для лучшей торсионной жесткости.  Конечно же это не всё (с полным списком можно ознакомиться ниже), но даже этого хватило бы для того, чтобы называться хорошей доской. Правда, в Capita не хотят быть «просто хорошими», их планка сильно выше, и Ultrafear ей вполне соответствует.\"}', 2, 3, '2021-01-26 10:11:59', '2021-01-26 10:24:38', NULL),
(5, 'Capita Indoor Survival 156', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Еще один универсальный вариант с уклоном во фристайл в коллекции Capita этого сезона, и какой вариант! Indoor Survival уже много лет является одним из хитов бренда, занимая достойное место в сноупарках по всему миру.</span><br /><br /><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Средняя жесткость, симметричная геометрия, прогиб Park V1 (основная часть доски между креплениями имеет небольшой классический кэмбер, переходящий в плоский прогиб) - все это поможет Вам сосредоточиться на катании, выполняя все задуманное, и половину задач она точно сможет решить без Вашего участия. Прочный и легкий деревянный сердечник из тополя и бука усилен карбоновыми вставками, а также имеет оплетку из биаксиального стекловолокна для лучшей торсионной жесткости и щелчка. Волокно Magic Bean, в составе которого находятся бобы, имеет самый высокий коэффициент прочности к весу, верхний слой Multitech&trade; Level 4, скользяк Quantum Drive&trade; - остальные компоненты тоже не подкачали, формируя в итоге стабильную конструкцию, готовую подняться с Вами еще на один уровень выше в стремлении к совершенству.</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong>&nbsp;средняя</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:&nbsp;</strong>продвинутый / эксперт</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong>&nbsp;twin tip</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong>&nbsp;</span><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">фристайл / универсальная / парк / джиб</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong>&nbsp;гибрид</span></div>', 0, 0, 0, 0, '221900', NULL, '2.50', 'male', '{\"title\": \"Capita Indoor Survival 156\", \"description\": \"Еще один универсальный вариант с уклоном во фристайл в коллекции Capita этого сезона, и какой вариант! Indoor Survival уже много лет является одним из хитов бренда, занимая достойное место в сноупарках по всему миру.  Средняя жесткость, симметричная геометрия, прогиб Park V1 (основная часть доски между креплениями имеет небольшой классический кэмбер, переходящий в плоский прогиб) - все это поможет Вам сосредоточиться на катании, выполняя все задуманное, и половину задач она точно сможет решить без Вашего участия. Прочный и легкий деревянный сердечник из тополя и бука усилен карбоновыми вставками, а также имеет оплетку из биаксиального стекловолокна для лучшей торсионной жесткости и щелчка. Волокно Magic Bean, в составе которого находятся бобы, имеет самый высокий коэффициент прочности к весу, верхний слой Multitech™ Level 4, скользяк Quantum Drive™ - остальные компоненты тоже не подкачали, формируя в итоге стабильную конструкцию, готовую подняться с Вами еще на один уровень выше в стремлении к совершенству.\"}', 2, 3, '2021-01-26 10:32:31', '2021-01-26 10:32:31', NULL),
(6, 'Capita Scott Stevens Mini 120', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Про-модель одного из самых креативных и известных райдеров даже не в команде Capita - во всем мире - уже второй сезон подряд имеет свою мини-версию для подрастающих сноубордистов. И если Вашему юному чемпиону нужна новая доска, начните поиск с этого варианта. В принципе, на нём же можно его и закончить, ведь доска безупречна!</span><br /><br /><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Небольшая жесткость будет прощать ошибки, прогиб Park Mini поможет прогрессировать как на линиях в парке так и за пределами подготовленных трасс, а симметричная геометрия и жесткость Twin не будут делать разницы между тем, какой ногой вперед едет юный падаван. Прочный скользяк XXX[TRUDED]&trade;, легкий сердечник, волокно Micro-Glass и верхний слой PAM16000&trade; - да в этой доске больше технологий, чем во многих взрослых моделях! Так что, как видите, Scott Stevens Mini явно заслуживает внимания. Уж на ближайшие несколько сезонов как минимум.</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong>&nbsp;средняя</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:&nbsp;</strong>продвинутый / эксперт</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong>&nbsp;directional</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong>&nbsp;фрирайд / универсальная</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong>&nbsp;гибрид</span></div>', 0, 0, 0, 0, '129900', NULL, '2.00', 'child', '{\"title\": \"Capita Scott Stevens Mini 120\", \"description\": \"Про-модель одного из самых креативных и известных райдеров даже не в команде Capita - во всем мире - уже второй сезон подряд имеет свою мини-версию для подрастающих сноубордистов. И если Вашему юному чемпиону нужна новая доска, начните поиск с этого варианта. В принципе, на нём же можно его и закончить, ведь доска безупречна!  Небольшая жесткость будет прощать ошибки, прогиб Park Mini поможет прогрессировать как на линиях в парке так и за пределами подготовленных трасс, а симметричная геометрия и жесткость Twin не будут делать разницы между тем, какой ногой вперед едет юный падаван. Прочный скользяк XXX[TRUDED]™, легкий сердечник, волокно Micro-Glass и верхний слой PAM16000™ - да в этой доске больше технологий, чем во многих взрослых моделях! Так что, как видите, Scott Stevens Mini явно заслуживает внимания. Уж на ближайшие несколько сезонов как минимум.\"}', 2, 3, '2021-01-26 10:45:47', '2021-01-26 10:45:47', NULL),
(7, 'Capita Paradise FW20 145', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Фристайл или трассовое катание - эта Capita Paradise с легкостью справится с любым вариантом, ведь брэнд специализируется именно на таких моделях. Небольшой рокер между креплениями, обратный прогиб на носу и хвосте - такой вариант покажет максимальную стабильность на скорости и жестком склоне и в то же время поплывет в глубоком снегу. Симметричная геометрия для приземлений и катания в свиче, прочный сердечник из древесины тополя и бука, титаналовые вставки для отличного щелчка и продольной жесткости и обновленный скользяк Superdrive&trade; Ex, хорошо впитывающий и задерживающий парафин, что препятствует его быстрому высыханию. Конечно, это не все ее опции, но даже перечисленного хватит, чтобы понять, что перед нами отличный сноуборд. Впрочем, у Capita других и не бывает.</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong>&nbsp;средняя</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:&nbsp;</strong>продвинутый / эксперт</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong>&nbsp;twin tip</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong>&nbsp;фристайл / универсальная</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong>&nbsp;гибрид</span></div>', 0, 0, 0, 0, '214900', NULL, '2.50', 'female', '{\"title\": \"Capita Paradise FW20 145\", \"description\": \"Фристайл или трассовое катание - эта Capita Paradise с легкостью справится с любым вариантом, ведь брэнд специализируется именно на таких моделях. Небольшой рокер между креплениями, обратный прогиб на носу и хвосте - такой вариант покажет максимальную стабильность на скорости и жестком склоне и в то же время поплывет в глубоком снегу. Симметричная геометрия для приземлений и катания в свиче, прочный сердечник из древесины тополя и бука, титаналовые вставки для отличного щелчка и продольной жесткости и обновленный скользяк Superdrive™ Ex, хорошо впитывающий и задерживающий парафин, что препятствует его быстрому высыханию. Конечно, это не все ее опции, но даже перечисленного хватит, чтобы понять, что перед нами отличный сноуборд. Впрочем, у Capita других и не бывает.\"}', 2, 3, '2021-01-26 12:06:01', '2021-01-26 12:06:01', NULL),
(8, 'Capita Paradise FW19 147', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Поколения сменяются, солнце садится и поднимается - всё уже было. Сноуборд Paradise от команды CAPiTA идеально сбалансированная женская версия Outerspace. Эта доска для фрирайда сочетает динамичность и стабильность в мягком паудере райских лесных участков, на целине и даже в парке. Профиль с кэмбером между креплениями для стабильности и отзывчивости и поднятыми в рокер носом и хвостом поможет избегать ошибок и прибавит уверенности.</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong>&nbsp;средняя</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:</strong>&nbsp;продвинутый</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong>&nbsp;twin tip</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong> фрирайд / универсальная</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong> гибрид</span></div>\r\n<p style=\"line-height: 1.2;\">&nbsp;</p>', 0, 0, 0, 0, '214900', NULL, '2.50', 'female', '{\"title\": \"Capita Paradise FW19 147\", \"description\": \"Поколения сменяются, солнце садится и поднимается - всё уже было. Сноуборд Paradise от команды CAPiTA идеально сбалансированная женская версия Outerspace. Эта доска для фрирайда сочетает динамичность и стабильность в мягком паудере райских лесных участков, на целине и даже в парке. Профиль с кэмбером между креплениями для стабильности и отзывчивости и поднятыми в рокер носом и хвостом поможет избегать ошибок и прибавит уверенности.\"}', 2, 3, '2021-01-26 12:25:29', '2021-01-26 12:25:29', NULL),
(9, 'Capita Space Metal Fantasy FW19 149', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Перед Вами - победитель самых известных тестов, проводимых журналом Transworld Snowboarding, - Good Wood. Эта доска стала первой в категории Best of Test, а это значит (как минимум), что перед нами качественный и надежный сноуборд, который оказался хорош по всем параметрам. Что, впрочем, неудивительно - симметричный твин со средней жесткостью, удобный и универсальный прогиб Freedom V2 с плоским основанием и поднятыми в рокер носом и хвостом, прочный сердечник из тополя и оплетка из стекловолокна с волокном Magic Bean, в составе которого находятся бобы, имеет самый высокий коэффициент прочности к весу. У Capita всегда получались отличные доски как для фристайла, так и для обычного катания по трассам, и эта - не исключение. Отличный универсал, который готов пережить с Вами вместе ближайшие несколько сезонов.</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong>&nbsp;средняя</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:</strong>&nbsp;продвинутый</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong>&nbsp;twin tip</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong> фристайл / универсальная</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong> плоский</span></div>\r\n<p style=\"line-height: 1.2;\">&nbsp;</p>', 0, 0, 0, 0, '180900', NULL, '2.50', 'female', '{\"title\": \"Capita Space Metal Fantasy FW19 149\", \"description\": \"Перед Вами - победитель самых известных тестов, проводимых журналом Transworld Snowboarding, - Good Wood. Эта доска стала первой в категории Best of Test, а это значит (как минимум), что перед нами качественный и надежный сноуборд, который оказался хорош по всем параметрам. Что, впрочем, неудивительно - симметричный твин со средней жесткостью, удобный и универсальный прогиб Freedom V2 с плоским основанием и поднятыми в рокер носом и хвостом, прочный сердечник из тополя и оплетка из стекловолокна с волокном Magic Bean, в составе которого находятся бобы, имеет самый высокий коэффициент прочности к весу. У Capita всегда получались отличные доски как для фристайла, так и для обычного катания по трассам, и эта - не исключение. Отличный универсал, который готов пережить с Вами вместе ближайшие несколько сезонов.\"}', 2, 3, '2021-01-26 13:09:29', '2021-01-26 13:09:29', NULL),
(10, 'Capita SB Diamond Tail', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Серия Spring Break у Capita Snowboards никогда не была похожа на другие доски, всегда выделялась и была узнаваема издалека. В этом сезоне ничего не поменялось, перед нами опять яркая и эффектная коллекция, которая выделит Вас на склоне (и за его пределами).</span><br /><br /><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Diamond Tail - это шортборд в единственной ростовке, предназначенный для того, чтобы сделать Ваше катание максимально похожим на скейтбординг - таким же фановым, быстрым и маневренным. Обладатель награды Snowboard Magazine Platinum Pick получил ее определенно не зря, модель получилась идеальной, соответствуя поставленным перед нею задачам на 100%. Прогиб Surf Rocker Profile поможет ей плыть и выплывать, направленная геометрия подстрахует даже в самом глубоком снегу, а тополиный сердечник Surflite 2.0 Core&trade;, дополненный вставками Forged Carbon Quad Packs, созданными совместно с Union Bindings, гарантирует великолепный щелчок и стабильность. Как видите, есть всё, чтобы в лучшие дни сезона осознать, что они лучшие!</span><br /><br /><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Эта доска не должна быть единственной для всего. Но будет идеальным выбором в качестве второго снаряда для паудера. Настало время правильных решений.</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong>&nbsp;средняя</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:&nbsp;</strong>продвинутый / эксперт</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong>&nbsp;directional</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong>&nbsp;фрирайд</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong>&nbsp;гибрид</span></div>', 0, 0, 0, 0, '500000', NULL, '2.50', 'male', '{\"title\": \"Capita SB Diamond Tail\", \"description\": \"Серия Spring Break у Capita Snowboards никогда не была похожа на другие доски, всегда выделялась и была узнаваема издалека. В этом сезоне ничего не поменялось, перед нами опять яркая и эффектная коллекция, которая выделит Вас на склоне (и за его пределами).  Diamond Tail - это шортборд в единственной ростовке, предназначенный для того, чтобы сделать Ваше катание максимально похожим на скейтбординг - таким же фановым, быстрым и маневренным. Обладатель награды Snowboard Magazine Platinum Pick получил ее определенно не зря, модель получилась идеальной, соответствуя поставленным перед нею задачам на 100%. Прогиб Surf Rocker Profile поможет ей плыть и выплывать, направленная геометрия подстрахует даже в самом глубоком снегу, а тополиный сердечник Surflite 2.0 Core™, дополненный вставками Forged Carbon Quad Packs, созданными совместно с Union Bindings, гарантирует великолепный щелчок и стабильность. Как видите, есть всё, чтобы в лучшие дни сезона осознать, что они лучшие!  Эта доска не должна быть единственной для всего. Но будет идеальным выбором в качестве второго снаряда для паудера. Настало время правильных решений.  Жёсткость: средняя Уровень: продвинутый / эксперт Геометрия: directional Назначение: фрирайд Прогиб: гибрид\"}', 2, 3, '2021-01-27 08:55:01', '2021-01-27 08:55:01', NULL),
(11, 'GNU T2B 155', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Обновленная модель T2B с направленной геометрией и увеличенной жесткостью. Прыжки с трамплинов, бэккантри-фристайл, стрит - вместе с этим сноубордом возможно абсолютно все! За счет прогиба C2 - выраженный рокер между зонами креплений с мягким эллиптическим кэмбером в зоне за закладными - доска отлично ведет себя на всех типах рельефа. Асимметричный шейп с разными радиусами бокового выреза и более мягким сердечником в районе заднего канта поднимет Вас на уровень выше и позволит в полной мере наслаждаться катанием. Конечно же, технология Magne-Traction, легкий и прочный сердечник из осины и павловнии, комбинированное стекловолокно - перед Вами доска, которая поможет Вам прогрессировать с каждым новым сезоном.</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong>&nbsp;средняя</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:&nbsp;</strong>продвинутый / эксперт</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong>&nbsp;directional</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong>&nbsp;фристайл / универсальная</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong>&nbsp;гибрид</span></div>', 0, 0, 0, 0, '267900', NULL, '2.50', 'male', '{\"title\": \"GNU T2B 155\", \"description\": \"Обновленная модель T2B с направленной геометрией и увеличенной жесткостью. Прыжки с трамплинов, бэккантри-фристайл, стрит - вместе с этим сноубордом возможно абсолютно все! За счет прогиба C2 - выраженный рокер между зонами креплений с мягким эллиптическим кэмбером в зоне за закладными - доска отлично ведет себя на всех типах рельефа. Асимметричный шейп с разными радиусами бокового выреза и более мягким сердечником в районе заднего канта поднимет Вас на уровень выше и позволит в полной мере наслаждаться катанием. Конечно же, технология Magne-Traction, легкий и прочный сердечник из осины и павловнии, комбинированное стекловолокно - перед Вами доска, которая поможет Вам прогрессировать с каждым новым сезоном.  Жёсткость: средняя Уровень: продвинутый / эксперт Геометрия: directional Назначение: фристайл / универсальная Прогиб: гибрид\"}', 3, 3, '2021-01-27 09:03:54', '2021-01-27 09:03:54', NULL),
(12, 'GNU Billy Goat 159', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Billy Goat выпускается GNU уже далеко не первый год, и в этом сезоне она все так же хороша, как и во всех предыдущих. Универсальная модель, она предназначена практически для всего и будет в полной мере отвечать Вашим запросам. Для этого сноуборд имеет стабильный и хорошо управляемый прогиб C3 Camber с выраженным вдоль всей доски кембером и мягким рокером между креплений, направленную геометрию, которая позволяет доске всплывать в условиях глубокого снега и сохранять отличную устойчивость на трассе. Magne-Traction, прочный сердечник, быстрый скользяк? И это тоже в наличии. Графику к Billy Goat традиционно делал Adam Haynes - так что с какой стороны ни посмотри, идеальная доска.</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong> жесткая</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:&nbsp;</strong>продвинутый / эксперт</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong>&nbsp;directional</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong>&nbsp;фрирайд / универсальная</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong>&nbsp;гибрид</span></div>', 0, 0, 0, 0, '329900', NULL, '2.50', 'male', '{\"title\": \"GNU Billy Goat 159\", \"description\": \"Billy Goat выпускается GNU уже далеко не первый год, и в этом сезоне она все так же хороша, как и во всех предыдущих. Универсальная модель, она предназначена практически для всего и будет в полной мере отвечать Вашим запросам. Для этого сноуборд имеет стабильный и хорошо управляемый прогиб C3 Camber с выраженным вдоль всей доски кембером и мягким рокером между креплений, направленную геометрию, которая позволяет доске всплывать в условиях глубокого снега и сохранять отличную устойчивость на трассе. Magne-Traction, прочный сердечник, быстрый скользяк? И это тоже в наличии. Графику к Billy Goat традиционно делал Adam Haynes - так что с какой стороны ни посмотри, идеальная доска.  Жёсткость: средняя Уровень: продвинутый / эксперт Геометрия: directional Назначение: фрирайд / универсальная Прогиб: гибрид\"}', 3, 3, '2021-01-27 09:17:06', '2021-01-27 09:49:14', NULL),
(13, 'GNU Mullair 155', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Про-модель Николаса Мюллера - жесткая, легкая, цепкая и стабильная, как и его невероятно крутой стиль, поможет прогрессировать в погоне за новыми достижениями и высотами. Прогиб C3 с сильно выраженным вдоль всей доски кэмбером и с мягким рокером между креплений для отличных ощущений даже в условиях глубокого снега, направленная геометрия Directional для устойчивости на трассе, а также технология Magne-Traction для спокойствия даже на самых плохих покрытиях и экологичные материалы и использованные для создания сердечника, крышки, скользяка и оплетки в угоду спасения планеты. Такую модель определенно не отпустишь в надежде на то, что она все сделает сама, она за это накажет. Но если Вашего уровня хватает на то, чтобы осознанно управлять ею, то получится отличный тандем, который поможет развивать Ваши навыки от спуска к спуску.</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong> жесткая</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:&nbsp;</strong>продвинутый / эксперт</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong>&nbsp;directional</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong>&nbsp;фрирайд / универсальная</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong>&nbsp;гибрид</span></div>', 0, 0, 0, 0, '359900', NULL, '2.50', 'male', '{\"title\": \"GNU Mullair 155\", \"description\": \"Про-модель Николаса Мюллера - жесткая, легкая, цепкая и стабильная, как и его невероятно крутой стиль, поможет прогрессировать в погоне за новыми достижениями и высотами. Прогиб C3 с сильно выраженным вдоль всей доски кэмбером и с мягким рокером между креплений для отличных ощущений даже в условиях глубокого снега, направленная геометрия Directional для устойчивости на трассе, а также технология Magne-Traction для спокойствия даже на самых плохих покрытиях и экологичные материалы и использованные для создания сердечника, крышки, скользяка и оплетки в угоду спасения планеты. Такую модель определенно не отпустишь в надежде на то, что она все сделает сама, она за это накажет. Но если Вашего уровня хватает на то, чтобы осознанно управлять ею, то получится отличный тандем, который поможет развивать Ваши навыки от спуска к спуску.  Жёсткость: средняя Уровень: продвинутый / эксперт Геометрия: directional Назначение: фрирайд / универсальная Прогиб: гибрид\"}', 3, 3, '2021-01-27 09:54:09', '2021-01-27 09:58:16', NULL),
(14, 'GNU Klassy 151', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Уже не первый сезон GNU Klassy выпускается при активном содействии Kaitlyn Farrington, сноубордистки с мировым именем, олимпийской чемпионки в хафпайпе и победительницы Европейских X-Games. Про-модель предлагает Вам производительность, сбалансированную конструкцию с отличными техническими характеристиками и красивую графику. Сноуборд оснащен прогибом С2X с более короткой, но агрессивной линией рокера и плавным кэмбером - он создан для быстрой езды, маневренности, отлично ведет себя как в глубоком снегу, так и при скоростном трассовом катании. У снаряда направленная геометрия Directional, которая помогает и всплывать в свежем паудере, и резать размашистые дуги, а за контроль отвечает волнообразный кант Magne-Traction и 7 его контактных точек. Отличный выбор для быстрого прогресса и высоких результатов.</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong> средняя</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:&nbsp;</strong>продвинутый / эксперт</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong>&nbsp;directional</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong>&nbsp;фрирайд / универсальная</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong>&nbsp;гибрид</span></div>', 0, 0, 0, 0, '307900', NULL, '2.50', 'male', '{\"title\": \"GNU Klassy 151\", \"description\": \"Уже не первый сезон GNU Klassy выпускается при активном содействии Kaitlyn Farrington, сноубордистки с мировым именем, олимпийской чемпионки в хафпайпе и победительницы Европейских X-Games. Про-модель предлагает Вам производительность, сбалансированную конструкцию с отличными техническими характеристиками и красивую графику. Сноуборд оснащен прогибом С2X с более короткой, но агрессивной линией рокера и плавным кэмбером - он создан для быстрой езды, маневренности, отлично ведет себя как в глубоком снегу, так и при скоростном трассовом катании. У снаряда направленная геометрия Directional, которая помогает и всплывать в свежем паудере, и резать размашистые дуги, а за контроль отвечает волнообразный кант Magne-Traction и 7 его контактных точек. Отличный выбор для быстрого прогресса и высоких результатов.  Жёсткость: средняя Уровень: продвинутый / эксперт Геометрия: directional Назначение: фрирайд / универсальная Прогиб: гибрид\"}', 3, 3, '2021-01-27 09:59:22', '2021-01-27 09:59:22', NULL),
(15, 'GNU 4 153', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Безграничное воображение заставляет Forest Bailey выражать себя на сноуборде всеми возможными способами - и GNU 4 отвечает всем его потребностям. Перед Вами универсальная доска, представляющая собой отличное сочетание цены и качества. Что касается технологий - это великолепный набор из прогиба C3 Camber, который по достоинству оценят опытные райдеры, Magne-Traction для хорошего сцепления с ледяными участками парка или склонов, легкого и прочного сердечника из древесины павловинии и осины, а также&nbsp; трехосевой и двухосевой оплетки, прочных боковых стенок и быстрого спеченного скользяка.</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong>&nbsp;жесткая</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:&nbsp;</strong>продвинутый / эксперт</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong>&nbsp;directional</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong> фристайл / универсальная</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong>&nbsp;гибрид&nbsp;</span></div>', 0, 0, 0, 0, '329900', NULL, '2.50', 'male', '{\"title\": \"GNU 4 153\", \"description\": \"Безграничное воображение заставляет Forest Bailey выражать себя на сноуборде всеми возможными способами - и GNU 4 отвечает всем его потребностям. Перед Вами универсальная доска, представляющая собой отличное сочетание цены и качества. Что касается технологий - это великолепный набор из прогиба C3 Camber, который по достоинству оценят опытные райдеры, Magne-Traction для хорошего сцепления с ледяными участками парка или склонов, легкого и прочного сердечника из древесины павловинии и осины, а также  трехосевой и двухосевой оплетки, прочных боковых стенок и быстрого спеченного скользяка.  Жёсткость: жесткая Уровень: продвинутый / эксперт Геометрия: directional Назначение: фристайл / универсальная Прогиб: гибрид\"}', 3, 3, '2021-01-27 10:03:52', '2021-01-27 10:03:52', NULL),
(16, 'Lib Tech MC Snake Kink 159', '<p style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Эту доску Вы наверняка узнаете издалека. Она стала еще ярче и заметнее, чем в прошлом сезоне, хотя тогда это казалось невозможным. Но для Мэтта Камминса и Дэмиана Фултона нет ничего невозможного, и вот уже Radical Rick на своем велосипеде покоряет очередной MC Snake Kink.</span><br /><br /><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\">Очередная экспериментальная модель для фрирайда, над которой работал Мэтт, получилась вполне себе универсальной, ведь отсутствие свежего снега не отменяет катания, а Snake Kink прекрасно чувствует себя как в метре паудера так и на жестком утреннем вельвете. Прогиб С3 (cильно выраженный вдоль всей доски кэмбер, с мягким рокером между креплений) - гарантия стабильности и уверенности на любом рельефе (а поможет этому обязательный для досок Lib Tech Magne-Traction), направленная геометрия Directional с более удлиненным носом относительно хвоста подстрахует в глубом снегу, а сердечник Original Power с оплеткой из комбинированного стекловолокна обеспечит общую жесткость и невероятный щелчок. Как видите, несмотря на ориентирование на внетрассовое катание, Snake Kink отлично будет себя чувствовать и в любых других условиях. Отдельно стоит упомянуть про графику. Ее автором уже не в первый раз стал Дэмиан Фултон - настоящая легенда, между прочим, как и Мэтт Камминс. В прошлом арт-директор Marvel Comics (что само по себе уровень), он начал свой творческий путь очень давно, и уже много лет назад влюбил в своего мульт-героя Радикального Рика множество будущих экстремалов по всему миру. В те времена Lib Tech была молодой командой, которой явно не хватало авторитета, чтобы обратиться к Дэмиану, но 25 лет спустя их совместная работа состоялась, и это еще один показатель того, что для настоящих мечтателей нет ничего невозможного!</span></p>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Жёсткость:</strong>&nbsp;средняя</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Уровень:&nbsp;</strong>продвинутый / эксперт</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Геометрия:</strong>&nbsp;directional</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Назначение:</strong>&nbsp;фрирайд / универсальная</span></div>\r\n<div style=\"line-height: 1.2;\"><span style=\"font-family: \'trebuchet ms\', geneva, sans-serif;\"><strong>Прогиб:</strong>&nbsp;гибрид</span></div>', 0, 0, 0, 0, '341900', NULL, '2.50', 'male', '{\"title\": \"Lib Tech MC Snake Kink 159\", \"description\": \"Эту доску Вы наверняка узнаете издалека. Она стала еще ярче и заметнее, чем в прошлом сезоне, хотя тогда это казалось невозможным. Но для Мэтта Камминса и Дэмиана Фултона нет ничего невозможного, и вот уже Radical Rick на своем велосипеде покоряет очередной MC Snake Kink.  Очередная экспериментальная модель для фрирайда, над которой работал Мэтт, получилась вполне себе универсальной, ведь отсутствие свежего снега не отменяет катания, а Snake Kink прекрасно чувствует себя как в метре паудера так и на жестком утреннем вельвете. Прогиб С3 (cильно выраженный вдоль всей доски кэмбер, с мягким рокером между креплений) - гарантия стабильности и уверенности на любом рельефе (а поможет этому обязательный для досок Lib Tech Magne-Traction), направленная геометрия Directional с более удлиненным носом относительно хвоста подстрахует в глубом снегу, а сердечник Original Power с оплеткой из комбинированного стекловолокна обеспечит общую жесткость и невероятный щелчок. Как видите, несмотря на ориентирование на внетрассовое катание, Snake Kink отлично будет себя чувствовать и в любых других условиях. Отдельно стоит упомянуть про графику. Ее автором уже не в первый раз стал Дэмиан Фултон - настоящая легенда, между прочим, как и Мэтт Камминс. В прошлом арт-директор Marvel Comics (что само по себе уровень), он начал свой творческий путь очень давно, и уже много лет назад влюбил в своего мульт-героя Радикального Рика множество будущих экстремалов по всему миру. В те времена Lib Tech была молодой командой, которой явно не хватало авторитета, чтобы обратиться к Дэмиану, но 25 лет спустя их совместная работа состоялась, и это еще один показатель того, что для настоящих мечтателей нет ничего невозможного!  Жёсткость: средняя Уровень: продвинутый / эксперт Геометрия: directional Назначение: фрирайд / универсальная Прогиб: гибрид\"}', 1, 3, '2021-01-27 10:13:22', '2021-01-27 15:45:36', '2021-01-27 15:45:36');
