owboards \\u043d\\u0438\\u043a\\u043e\\u0433\\u0434\\u0430 \\u043d\\u0435 \\u0431\\u044b\\u043b\\u0430 \\u043f\\u043e\\u0445\\u043e\\u0436\\u0430 \\u043d\\u0430 \\u0434\\u0440\\u0443\\u0433\\u0438\\u0435 \\u0434\\u043e\\u0441\\u043a\\u0438, \\u0432\\u0441\\u0435\\u0433\\u0434\\u0430 \\u0432\\u044b\\u0434\\u0435\\u043b\\u044f\\u043b\\u0430\\u0441\\u044c \\u0438 \\u0431\\u044b\\u043b\\u0430 \\u0443\\u0437\\u043d\\u0430\\u0432\\u0430\\u0435\\u043c\\u0430 \\u0438\\u0437\\u0434\\u0430\\u043b\\u0435\\u043a\\u0430. \\u0412 \\u044d\\u0442\\u043e\\u043c \\u0441\\u0435\\u0437\\u043e\\u043d\\u0435 \\u043d\\u0438\\u0447\\u0435\\u0433\\u043e \\u043d\\u0435 \\u043f\\u043e\\u043c\\u0435\\u043d\\u044f\\u043b\\u043e\\u0441\\u044c, \\u043f\\u0435\\u0440\\u0435\\u0434 \\u043d\\u0430\\u043c\\u0438 \\u043e\\u043f\\u044f\\u0442\\u044c \\u044f\\u0440\\u043a\\u0430\\u044f \\u0438 \\u044d\\u0444\\u0444\\u0435\\u043a\\u0442\\u043d\\u0430\\u044f \\u043a\\u043e\\u043b\\u043b\\u0435\\u043a\\u0446\\u0438\\u044f, \\u043a\\u043e\\u0442\\u043e\\u0440\\u0430\\u044f \\u0432\\u044b\\u0434\\u0435\\u043b\\u0438\\u0442 \\u0412\\u0430\\u0441 \\u043d\\u0430 \\u0441\\u043a\\u043b\\u043e\\u043d\\u0435 (\\u0438 \\u0437\\u0430 \\u0435\\u0433\\u043e \\u043f\\u0440\\u0435\\u0434\\u0435\\u043b\\u0430\\u043c\\u0438).<\\/span><br \\/><br \\/><span style=\\\"font-family: \'trebuchet ms\', geneva, sans-serif;\\\">Diamond Tail - \\u044d\\u0442\\u043e \\u0448\\u043e\\u0440\\u0442\\u0431\\u043e\\u0440\\u0434 \\u0432 \\u0435\\u0434\\u0438\\u043d\\u0441\\u0442\\u0432\\u0435\\u043d\\u043d\\u043e\\u0439 \\u0440\\u043e\\u0441\\u0442\\u043e\\u0432\\u043a\\u0435, \\u043f\\u0440\\u0435\\u0434\\u043d\\u0430\\u0437\\u043d\\u0430\\u0447\\u0435\\u043d\\u043d\\u044b\\u0439 \\u0434\\u043b\\u044f \\u0442\\u043e\\u0433\\u043e, \\u0447\\u0442\\u043e\\u0431\\u044b \\u0441\\u0434\\u0435\\u043b\\u0430\\u0442\\u044c \\u0412\\u0430\\u0448\\u0435 \\u043a\\u0430\\u0442\\u0430\\u043d\\u0438\\u0435 \\u043c\\u0430\\u043a\\u0441\\u0438\\u043c\\u04