043e\\u0431\\u0435\\u0441\\u043f\\u0435\\u0447\\u0438\\u0442 \\u043e\\u0431\\u0449\\u0443\\u044e \\u0436\\u0435\\u0441\\u0442\\u043a\\u043e\\u0441\\u0442\\u044c \\u0438 \\u043d\\u0435\\u0432\\u0435\\u0440\\u043e\\u044f\\u0442\\u043d\\u044b\\u0439 \\u0449\\u0435\\u043b\\u0447\\u043e\\u043a. \\u041a\\u0430\\u043a \\u0432\\u0438\\u0434\\u0438\\u0442\\u0435, \\u043d\\u0435\\u0441\\u043c\\u043e\\u0442\\u0440\\u044f \\u043d\\u0430 \\u043e\\u0440\\u0438\\u0435\\u043d\\u0442\\u0438\\u0440\\u043e\\u0432\\u0430\\u043d\\u0438\\u0435 \\u043d\\u0430 \\u0432\\u043d\\u0435\\u0442\\u0440\\u0430\\u0441\\u0441\\u043e\\u0432\\u043e\\u0435 \\u043a\\u0430\\u0442\\u0430\\u043d\\u0438\\u0435, Snake Kink \\u043e\\u0442\\u043b\\u0438\\u0447\\u043d\\u043e \\u0431\\u0443\\u0434\\u0435\\u0442 \\u0441\\u0435\\u0431\\u044f \\u0447\\u0443\\u0432\\u0441\\u0442\\u0432\\u043e\\u0432\\u0430\\u0442\\u044c \\u0438 \\u0432 \\u043b\\u044e\\u0431\\u044b\\u0445 \\u0434\\u0440\\u0443\\u0433\\u0438\\u0445 \\u0443\\u0441\\u043b\\u043e\\u0432\\u0438\\u044f\\u0445. \\u041e\\u0442\\u0434\\u0435\\u043b\\u044c\\u043d\\u043e \\u0441\\u0442\\u043e\\u0438\\u0442 \\u0443\\u043f\\u043e\\u043c\\u044f\\u043d\\u0443\\u0442\\u044c \\u043f\\u0440\\u043e \\u0433\\u0440\\u0430\\u0444\\u0438\\u043a\\u0443. \\u0415\\u0435 \\u0430\\u0432\\u0442\\u043e\\u0440\\u043e\\u043c \\u0443\\u0436\\u0435 \\u043d\\u0435 \\u0432 \\u043f\\u0435\\u0440\\u0432\\u044b\\u0439 \\u0440\\u0430\\u0437 \\u0441\\u0442\\u0430\\u043b \\u0414\\u044d\\u043c\\u0438\\u0430\\u043d \\u0424\\u0443\\u043b\\u0442\\u043e\\u043d - \\u043d\\u0430\\u0441\\u0442\\u043e\\u044f\\u0449\\u0430\\u044f \\u043b\\u0435\\u0433\\u0435\\u043d\\u0434\\u0430, \\u043c\\u0435\\u0436\\u0434\\u0443 \\u043f\\u0440\\u043e\\u0447\\u0438\\u043c, \\u043a\\u0430\\u043a \\u0438 \\u041c\\u044d\\u0442\\u0442 \\u041a\\u0430\\u043c\\u043c\\u0438\\u043d\\u0441. \\u0412 \\u043f\\u0440\\u043e\\u0448\\u043b\\u043e\\u043c \\u0430\\u0440\\u0442-\\u0434\\u0438\\u0440\\u0435\\u043a\\u0442\\u043e\\u0440 