42\\u0432\\u043e\\u0440\\u0447\\u0435\\u0441\\u043a\\u0438\\u0439 \\u043f\\u0443\\u0442\\u044c \\u043e\\u0447\\u0435\\u043d\\u044c \\u0434\\u0430\\u0432\\u043d\\u043e, \\u0438 \\u0443\\u0436\\u0435 \\u043c\\u043d\\u043e\\u0433\\u043e \\u043b\\u0435\\u0442 \\u043d\\u0430\\u0437\\u0430\\u0434 \\u0432\\u043b\\u044e\\u0431\\u0438\\u043b \\u0432 \\u0441\\u0432\\u043e\\u0435\\u0433\\u043e \\u043c\\u0443\\u043b\\u044c\\u0442-\\u0433\\u0435\\u0440\\u043e\\u044f \\u0420\\u0430\\u0434\\u0438\\u043a\\u0430\\u043b\\u044c\\u043d\\u043e\\u0433\\u043e \\u0420\\u0438\\u043a\\u0430 \\u043c\\u043d\\u043e\\u0436\\u0435\\u0441\\u0442\\u0432\\u043e \\u0431\\u0443\\u0434\\u0443\\u0449\\u0438\\u0445 \\u044d\\u043a\\u0441\\u0442\\u0440\\u0435\\u043c\\u0430\\u043b\\u043e\\u0432 \\u043f\\u043e \\u0432\\u0441\\u0435\\u043c\\u0443 \\u043c\\u0438\\u0440\\u0443. \\u0412 \\u0442\\u0435 \\u0432\\u0440\\u0435\\u043c\\u0435\\u043d\\u0430 Lib Tech \\u0431\\u044b\\u043b\\u0430 \\u043c\\u043e\\u043b\\u043e\\u0434\\u043e\\u0439 \\u043a\\u043e\\u043c\\u0430\\u043d\\u0434\\u043e\\u0439, \\u043a\\u043e\\u0442\\u043e\\u0440\\u043e\\u0439 \\u044f\\u0432\\u043d\\u043e \\u043d\\u0435 \\u0445\\u0432\\u0430\\u0442\\u0430\\u043b\\u043e \\u0430\\u0432\\u0442\\u043e\\u0440\\u0438\\u0442\\u0435\\u0442\\u0430, \\u0447\\u0442\\u043e\\u0431\\u044b \\u043e\\u0431\\u0440\\u0430\\u0442\\u0438\\u0442\\u044c\\u0441\\u044f \\u043a \\u0414\\u044d\\u043c\\u0438\\u0430\\u043d\\u0443, \\u043d\\u043e 25 \\u043b\\u0435\\u0442 \\u0441\\u043f\\u0443\\u0441\\u0442\\u044f \\u0438\\u0445 \\u0441\\u043e\\u0432\\u043c\\u0435\\u0441\\u0442\\u043d\\u0430\\u044f \\u0440\\u0430\\u0431\\u043e\\u0442\\u0430 \\u0441\\u043e\\u0441\\u0442\\u043e\\u044f\\u043b\\u0430\\u0441\\u044c, \\u0438 \\u044d\\u0442\\u043e \\u0435\\u0449\\u0435 \\u043e\\u0434\\u0438\\u043d \\u043f\\u043e\\u043a\\u0430\\u0437\\u0430\\u0442\\u0435\\u043b\\u044c \\u0442\\u043e\\u0433\\u043e, \\u0447\\u0442\\u043e \\u0434\\u043b\\u044f \\u043d\\u0430\\u0441\\u0442\\u043e\\u044f\\