4f \\u044d\\u043a\\u0441\\u043f\\u0435\\u0440\\u0438\\u043c\\u0435\\u043d\\u0442\\u0430\\u043b\\u044c\\u043d\\u0430\\u044f \\u043c\\u043e\\u0434\\u0435\\u043b\\u044c \\u0434\\u043b\\u044f \\u0444\\u0440\\u0438\\u0440\\u0430\\u0439\\u0434\\u0430, \\u043d\\u0430\\u0434 \\u043a\\u043e\\u0442\\u043e\\u0440\\u043e\\u0439 \\u0440\\u0430\\u0431\\u043e\\u0442\\u0430\\u043b \\u041c\\u044d\\u0442\\u0442, \\u043f\\u043e\\u043b\\u0443\\u0447\\u0438\\u043b\\u0430\\u0441\\u044c \\u0432\\u043f\\u043e\\u043b\\u043d\\u0435 \\u0441\\u0435\\u0431\\u0435 \\u0443\\u043d\\u0438\\u0432\\u0435\\u0440\\u0441\\u0430\\u043b\\u044c\\u043d\\u043e\\u0439, \\u0432\\u0435\\u0434\\u044c \\u043e\\u0442\\u0441\\u0443\\u0442\\u0441\\u0442\\u0432\\u0438\\u0435 \\u0441\\u0432\\u0435\\u0436\\u0435\\u0433\\u043e \\u0441\\u043d\\u0435\\u0433\\u0430 \\u043d\\u0435 \\u043e\\u0442\\u043c\\u0435\\u043d\\u044f\\u0435\\u0442 \\u043a\\u0430\\u0442\\u0430\\u043d\\u0438\\u044f, \\u0430 Snake Kink \\u043f\\u0440\\u0435\\u043a\\u0440\\u0430\\u0441\\u043d\\u043e \\u0447\\u0443\\u0432\\u0441\\u0442\\u0432\\u0443\\u0435\\u0442 \\u0441\\u0435\\u0431\\u044f \\u043a\\u0430\\u043a \\u0432 \\u043c\\u0435\\u0442\\u0440\\u0435 \\u043f\\u0430\\u0443\\u0434\\u0435\\u0440\\u0430 \\u0442\\u0430\\u043a \\u0438 \\u043d\\u0430 \\u0436\\u0435\\u0441\\u0442\\u043a\\u043e\\u043c \\u0443\\u0442\\u0440\\u0435\\u043d\\u043d\\u0435\\u043c \\u0432\\u0435\\u043b\\u044c\\u0432\\u0435\\u0442\\u0435. \\u041f\\u0440\\u043e\\u0433\\u0438\\u0431 \\u04213 (c\\u0438\\u043b\\u044c\\u043d\\u043e \\u0432\\u044b\\u0440\\u0430\\u0436\\u0435\\u043d\\u043d\\u044b\\u0439 \\u0432\\u0434\\u043e\\u043b\\u044c \\u0432\\u0441\\u0435\\u0439 \\u0434\\u043e\\u0441\\u043a\\u0438 \\u043a\\u044d\\u043c\\u0431\\u0435\\u0440, \\u0441 \\u043c\\u044f\\u0433\\u043a\\u0438\\u043c \\u0440\\u043e\\u043a\\u0435\\u0440\\u043e\\u043c \\u043c\\u0435\\u0436\\u0434\\u0443 \\u043a\\u0440\\u0435\\u043f\\u043b\\u0435\\u043d\\u0438\\u0439) - \\u0433\\u0430\\u0440\\u0430\\u043d\\u0442\\u