3e\\u0434\\u043e\\u0439 \\u043a\\u043e\\u043c\\u0430\\u043d\\u0434\\u043e\\u0439, \\u043a\\u043e\\u0442\\u043e\\u0440\\u043e\\u0439 \\u044f\\u0432\\u043d\\u043e \\u043d\\u0435 \\u0445\\u0432\\u0430\\u0442\\u0430\\u043b\\u043e \\u0430\\u0432\\u0442\\u043e\\u0440\\u0438\\u0442\\u0435\\u0442\\u0430, \\u0447\\u0442\\u043e\\u0431\\u044b \\u043e\\u0431\\u0440\\u0430\\u0442\\u0438\\u0442\\u044c\\u0441\\u044f \\u043a \\u0414\\u044d\\u043c\\u0438\\u0430\\u043d\\u0443, \\u043d\\u043e 25 \\u043b\\u0435\\u0442 \\u0441\\u043f\\u0443\\u0441\\u0442\\u044f \\u0438\\u0445 \\u0441\\u043e\\u0432\\u043c\\u0435\\u0441\\u0442\\u043d\\u0430\\u044f \\u0440\\u0430\\u0431\\u043e\\u0442\\u0430 \\u0441\\u043e\\u0441\\u0442\\u043e\\u044f\\u043b\\u0430\\u0441\\u044c, \\u0438 \\u044d\\u0442\\u043e \\u0435\\u0449\\u0435 \\u043e\\u0434\\u0438\\u043d \\u043f\\u043e\\u043a\\u0430\\u0437\\u0430\\u0442\\u0435\\u043b\\u044c \\u0442\\u043e\\u0433\\u043e, \\u0447\\u0442\\u043e \\u0434\\u043b\\u044f \\u043d\\u0430\\u0441\\u0442\\u043e\\u044f\\u0449\\u0438\\u0445 \\u043c\\u0435\\u0447\\u0442\\u0430\\u0442\\u0435\\u043b\\u0435\\u0439 \\u043d\\u0435\\u0442 \\u043d\\u0438\\u0447\\u0435\\u0433\\u043e \\u043d\\u0435\\u0432\\u043e\\u0437\\u043c\\u043e\\u0436\\u043d\\u043e\\u0433\\u043e!  \\u0416\\u0451\\u0441\\u0442\\u043a\\u043e\\u0441\\u0442\\u044c: \\u0441\\u0440\\u0435\\u0434\\u043d\\u044f\\u044f \\u0423\\u0440\\u043e\\u0432\\u0435\\u043d\\u044c: \\u043f\\u0440\\u043e\\u0434\\u0432\\u0438\\u043d\\u0443\\u0442\\u044b\\u0439 \\/ \\u044d\\u043a\\u0441\\u043f\\u0435\\u0440\\u0442 \\u0413\\u0435\\u043e\\u043c\\u0435\\u0442\\u0440\\u0438\\u044f: directional \\u041d\\u0430\\u0437\\u043d\\u0430\\u0447\\u0435\\u043d\\u0438\\u0435: \\u0444\\u0440\\u0438\\u0440\\u0430\\u0439\\u0434 \\/ \\u0443\\u043d\\u0438\\u0432\\u0435\\u0440\\u0441\\u0430\\u043b\\u044c\\u043d\\u0430\\u044f \\u041f\\u0440\\u043e\\u0433\\u0438\\u0431: \\u0433\\u0438\\u0431\\u0440\\u0438\\u0434\"},\"brand_id\":1,\"category_id\":3,\"created_at\":\"2021-0